sys_variable_value.value:
(function execute(inputs, outputs) {
  //We want start nums to be: 1 -> 1, 2 -> 101, 3 -> 201, etc.
  outputs.start_num = (inputs.loop_num-1)*100+1
})(inputs, outputs);

