sys_variable_value.value:
(function execute(inputs, outputs) {
  var body = JSON.parse(inputs.body);
  outputs.next = body.data.next;
  outputs.total = body.data.total;

  //Loop through all returned devices and populate arrays of IDs and MACs
  outputs.entries = {};
  for (i=0; i < body.data.count; i++)
  {
   outputs.entries[i] = body.data.data[i]
  }

  //We want to loop enough times to get everything. 
  //If we have 150 entries, we want to loop twice.
  outputs.max_loop = Math.ceil(body.data.total/100)
})(inputs, outputs);

